import React from 'react';
import Bar from './components/Bar';
import './rekrutacja.css';
import Heading from './components/Heading';
  
const Rekrutacja = () => {
  return (
    <div>
      <Bar title={"Rekrutacja"} />
      <Heading title={'Rekrutacja'}/>
    </div>
  );
};
  
export default Rekrutacja;
